import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { Container } from 'react-bootstrap';
import Header from './components/Header';
import Footer from './components/Footer';
import Home from './components/Home';
import ProductList from './components/ProductList';
import ProductDetail from './components/ProductDetail';
import Cart from './components/Cart';
import OrderForm from './components/OrderForm';
import OrderHistory from './components/OrderHistory';
import AdminProductList from './components/AdminProductList';
import CreateCustomerForm from './components/CreateCustomerForm';
import CustomerList from './components/CustomerList';
import CreateProductForm from './components/CreateProductForm';
import UpdateCustomerForm from './components/UpdateCustomerForm';
import UpdateProductForm from './components/UpdateProductForm';

const App = () => {
    const [products, setProducts] = useState([]);
    const [cartItems, setCartItems] = useState([]);
    const [customers, setCustomers] = useState([]);
    const [orders, setOrders] = useState([]);

    useEffect(() => {
        fetch('/products.json')
            .then(response => response.json())
            .then(data => setProducts(data))
            .catch(error => console.error('Error fetching products:', error));
    }, []);

    const addToCart = (product, quantity) => {
        const existingProduct = cartItems.find(item => item.id === product.id);
        if (existingProduct) {
            setCartItems(
                cartItems.map(item =>
                    item.id === product.id ? { ...item, quantity: item.quantity + quantity } : item
                )
            );
        } else {
            setCartItems([...cartItems, { ...product, quantity }]);
        }
    };

    const removeFromCart = (id) => {
        setCartItems(cartItems.filter(item => item.id !== id));
    };

    const createCustomer = (customer) => {
        setCustomers([...customers, customer]);
    };

    const updateCustomer = (updatedCustomer) => {
        setCustomers(customers.map(customer => customer.id === updatedCustomer.id ? updatedCustomer : customer));
    };

    const createProduct = (product) => {
        setProducts([...products, product]);
    };

    const updateProduct = (updatedProduct) => {
        setProducts(products.map(product => product.id === updatedProduct.id ? updatedProduct : product));
    };

    const placeOrder = (order) => {
        setOrders([...orders, order]);
    };

    const cancelOrder = (id) => {
        setOrders(orders.filter(order => order.id !== id));
    };

    return (
        <Router>
            <Header />
            <main className="py-3">
                <Container>
                    <Routes>
                        <Route path="/" element={<Home />} />
                        <Route path="/products" element={<ProductList addToCart={addToCart} />} />
                        <Route path="/product/:id" element={<ProductDetail addToCart={addToCart} />} />
                        <Route path="/cart" element={<Cart cartItems={cartItems} removeFromCart={removeFromCart} />} />
                        <Route path="/checkout" element={<OrderForm cartItems={cartItems} placeOrder={placeOrder} />} />
                        <Route path="/orders" element={<OrderHistory orders={orders} cancelOrder={cancelOrder} />} />
                        <Route path="/admin/products" element={<AdminProductList products={products} updateProduct={updateProduct} />} />
                        <Route path="/create-customer" element={<CreateCustomerForm createCustomer={createCustomer} />} />
                        <Route path="/customer-list" element={<CustomerList customers={customers} />} />
                        <Route path="/create-product" element={<CreateProductForm createProduct={createProduct} />} />
                        <Route path="/update-customer/:id" element={<UpdateCustomerForm customers={customers} updateCustomer={updateCustomer} />} />
                        <Route path="/update-product/:id" element={<UpdateProductForm products={products} updateProduct={updateProduct} />} />
                    </Routes>
                </Container>
            </main>
            <Footer />
        </Router>
    );
};

export default App;
